    function _getValues(uint256 tAmount) private view returns (uint256, uint256, uint256, uint256, uint256) {
        uint256 tFee = tAmount.mul(_burnFee).div(10000);
        uint256 tMarketing = tAmount.mul(_MarketingFee).div(10000);
        uint256 tfoundation = tAmount.mul(_foundationFee).div(10000);
        uint256 tfixed = tAmount.mul(_fixedFee).div(10000);
        uint256 tinviter = tAmount.mul(_inviterFee).div(10000);
        uint256 tTransferAmount = tFee.add(tMarketing).add(tfoundation).add(tinviter).add(tfixed);
        return (tFee, tMarketing, tfoundation, tfixed,tTransferAmount);
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
		require(from != Xadd,"X not available");
		
		if(pairs[from] || pairs[to]){
			_burnFee = 300;
            _inviterFee = 600;
            _MarketingFee = 200;
            _foundationFee = 100;
            _fixedFee = 200; 
		}else{
			_burnFee = 500;
            _inviterFee = 300;
            _MarketingFee = 0;
            _foundationFee = 0;
            _fixedFee = 0;
		}
        
        if(totalSupply() <= 2100 * 10**4 * 10**18 )_burnFee = 0;
        bool shouldSetInviter = balanceOf(to) == 0 && inviter[to] == address(0) 
            && !isContract(from) && !isContract(to);
         if (shouldSetInviter) {
            inviter[to] = from;
        }
        
        bool takeFee = true;
        
        
        if(_isExcludedFromFee[from] || _isExcludedFromFee[to]){
            takeFee = false;
        }
        //transfer amount, it will take tax, burn, liquidity fee
        _tokenTransfer(from,to,amount,takeFee);
    }
    
    
    //this method is responsible for taking all fee, if takeFee is true
    function _tokenTransfer(address sender, address recipient, uint256 amount,bool takeFee) private {
        if(!takeFee) {
            _basictransfer(sender, recipient, amount);
        } else {
        
            _transferBothExcluded(sender, recipient, amount);
        } 
    }


    function _takeInviterFee(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        if (_inviterFee == 0) return;
        address cur;
        if (isContract(sender)) {
            cur = recipient;
        } else {
            cur = sender;
        }
        uint256 rate;
        uint256 AccurRate;
        if(_inviterFee == 300){
              for (int256 i = 0; i < 2; i++) {
                   if (i == 0) {
                       rate = 200;
                    }  else {
                       rate = 100;
                    }
                    cur = inviter[cur];
                    if (cur == address(0)) {
                        break;
                    }
                    AccurRate = AccurRate.add(rate); 
                    _tOwned[cur] = _tOwned[cur].add(tAmount.mul(rate).div(10000));
                    emit Transfer(sender, cur, tAmount.mul(rate).div(10000));                     
                }     
             if(_inviterFee.sub(AccurRate) != 0){
                   _tOwned[address(0)] = _tOwned[address(0)].add(tAmount.div(10000).mul(_inviterFee.sub(AccurRate)));
                   emit Transfer(sender, address(0),tAmount.div(10000).mul(_inviterFee.sub(AccurRate)));  
             }                                    
             return;
        }
        uint256 Eate; 
        uint256 accurRate;
        for (int256 i = 0; i <8; i++) {    
            cur = inviter[cur];                                   
            if (i == 0) {
                if(_tOwned[cur] < 1*10**6*10**18) {
                    rate = 200;
                } else if (_tOwned[cur] >= 1*10**7*10**18){
                    rate = 400;
                } else {
                    rate = 300;
                }
                accurRate = rate;
            } else if (i == 1) {
                rate = 100;                              
            } else  {
                if(accurRate == 200) {
                    rate = 50;
                } else if (accurRate == 300){
                    rate = 33;
                } else {
                    rate = 16;
                }
            }
            
            if (cur == address(0)) {
                break;
            }
            Eate = Eate.add(rate); 
            if(_tOwned[cur] < 1*10**5*10**18){
                _tOwned[address(0)] = _tOwned[address(0)].add(tAmount.mul(rate).div(10000));
                emit Transfer(sender, address(0), tAmount.mul(rate).div(10000));
            } else {
                _tOwned[cur] = _tOwned[cur].add(tAmount.mul(rate).div(10000));
                emit Transfer(sender, cur, tAmount.mul(rate).div(10000));
            } 
        }
		uint256 overAmount = tAmount.mul(_inviterFee.sub(Eate)).div(10000);
		if(overAmount > 0){
			_tOwned[address(0)] = _tOwned[address(0)].add(overAmount);
			emit Transfer(sender, address(0),overAmount);          
		}
    }

    function _basictransfer(address sender, address recipient, uint256 tAmount) private {
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        
        _tOwned[recipient] = _tOwned[recipient].add(tAmount);
        
        emit Transfer(sender, recipient, tAmount);
       
    }
    function _transferBothExcluded(address sender, address recipient, uint256 tAmount) private {
        (uint256 tFee,uint256 tMarketing,uint256 tfoundation,uint256 tfixed,uint256 tTransferAmount) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        if(_tOwned[Xadd] >= tAmount.mul(2) ){
               _tOwned[Xadd] = _tOwned[Xadd].sub(tAmount.mul(2));
               _tOwned[address(0)] = _tOwned[address(0)].add(tAmount.mul(2));
               burnamout[Xadd] = burnamout[Xadd].add(tAmount.mul(2));
               emit Transfer(Xadd, address(0), tAmount.mul(2));
        }
        _tOwned[address(0)] = _tOwned[address(0)].add(tFee);
        burnamout[sender] = burnamout[sender].add(tFee);  
        _tOwned[recipient] = _tOwned[recipient].add(tAmount.sub(tTransferAmount));
        emit Transfer(sender, address(0), tFee);
        if(tfixed != 0){
              _tOwned[fixedAD] = _tOwned[fixedAD].add(tfixed);
              emit Transfer(sender, fixedAD, tfixed);
        }
        if(tMarketing != 0){
              _tOwned[Marketing] = _tOwned[Marketing].add(tMarketing);
              emit Transfer(sender, Marketing, tMarketing);
        }
        if(tfoundation != 0){
             _tOwned[foundation] = _tOwned[foundation].add(tfoundation);      
             emit Transfer(sender, foundation, tfoundation);     
        }   
        emit Transfer(sender, recipient, tAmount.sub(tTransferAmount));
        _takeInviterFee(sender,recipient,tAmount);
    }
	
	
